import React, { useState, useEffect } from "react";
import Neptune from "../assets/img/monstersAvatars/Neptune.png";

function Game() {
  const [player, setCount] = useState(0);
  return (
    <div className="game">
      <div className="fractalMonster">
        <div className="monsterAvatar">
          <img src={Neptune} alt="" />
        </div>
        <div className="monsterLifebar"></div>
      </div>
      <div className="startButton">
        <button>start</button>
      </div>
      <div className="player">
        <div className="playerLifebar"></div>
      </div>
    </div>
  );
}

export default Game;
